// This is copied from CustOpenInvoicesLookup
// The query and view were also copied from CustOpenInvoices
// To copy the query and view, the originals were exported, renamed and then imported.
public class SKS_LB_CustOpenInvoicesLookup extends FormRun
{
    AccountNum accountNum;
    FormRun callerForm;
    SKS_LB_JournalARErrors callerSKS_LB_JournalARErrors;

    boolean interCompanyAccountEnabled;
    CompanyId accountNumCompany;
    DirPartyRecId accountNumParty;
    boolean useCurrentCompanyTab;
}

public void closeSelect(str _selectString)
{
    ;
    super(_selectString);

    if (callerForm && callerForm.dataSource())
    {
        if (useCurrentCompanyTab)
        {
            element.setJournalARErrorFields(CustTrans.Invoice, CustTransOpen.recid, CustTrans.dataareaid, custtrans.accountnum, sks_lb_invoicematch.MatchType, SKS_LB_InvoiceMatch.Matchvalue);
        }
        else
        {
            element.setJournalARErrorFields(CustTransMC.Invoice, CustTransOpenMC.recid, CustTransMC.dataareaid, CustTransMC.accountnum, sks_lb_invoicematch.MatchType, SKS_LB_InvoiceMatch.Matchvalue);
        }
    }
}

public void init()
{
    ;
    super();

    if (this.args())
    {
        if (this.args().record().TableId == tablenum(SKS_LB_JournalARErrors))
        {
            //Get the caller's LedgerJournalTrans record.
            callerSKS_LB_JournalARErrors = this.args().record();
            if(callerSKS_LB_JournalARErrors.CustAccountSugg == '')
            {
                accountNum = callerSKS_LB_JournalARErrors.CustAccount;
            }
            else
            {
                accountNum = callerSKS_LB_JournalARErrors.CustAccountSugg;
            }

            if(callerSKS_LB_JournalARErrors.CustomerCompany)
            {
                accountNumCompany = callerSKS_LB_JournalARErrors.CustomerCompany;
            }
            else
            {
                accountNumCompany = callerSKS_LB_JournalARErrors.dataAreaId;
            }

            accountNumParty = CustTable::findByCompany(accountNumCompany, accountNum).Party;
        }

        if (element.args().caller())
        {
            //Get the caller form.
            callerForm = element.args().caller();
        }
    }

    interCompanyAccountEnabled = isConfigurationkeyEnabled(configurationkeynum(LedgerAdvIntercompanyAccounting));

    //Added for BP fix
    Tab.tab(1);
}

void run()
{
    //FormStringControl callerControl = SysTableLookup::getCallerStringControl(element.args());
    //;

    // Set the caption for the tabcontrol
    currentCompany.caption(strfmt("@SYS116204", accountNumCompany));

    // Specify which field we want the lookup to get its value from
    element.selectMode(CustTrans_Invoice);
    useCurrentCompanyTab = true;

    // Display correct tabcontrol depending on if InterCompany accounting is visible
    if (!interCompanyAccountEnabled)
    {
        // Hide AllCompanies tabcontrol
        allCompanies.visible(false);
    }

    super();

}

void setJournalARErrorFields(InvoiceId _Invoice, Int64 _RecId, CompanyId _customerCompany, CustAccount _CustAccount, sks_lb_Matchtype Matchtype, InvoiceID Matchvalue)
{
    CustTransOpen lcustTransOpen;
    ;

    callerSKS_LB_JournalARErrors.Invoice                = _Invoice;
    callerSKS_LB_JournalARErrors.CustTransOpenRecId     = _RecId;

    if(callerSKS_LB_JournalARErrors.CustAccountSugg == '')
    {
        callerSKS_LB_JournalARErrors.CustAccountSugg = _CustAccount;
        callerSKS_LB_JournalARErrors.CustomerCompany = _customerCompany;
        callerSKS_LB_JournalARErrors.CustAccountErr = SKS_LB_CustIDErr::ManualLookup;

    }
    // Need to get CustTransOpen so CustTransRecId can be set
    callerSKS_LB_JournalARErrors.AltInvLookupRef = Matchvalue;
    callerSKS_LB_JournalARErrors.AltInvLookupType = Matchtype;

    changecompany(_customerCompany)
    {

        lcustTransOpen = custTransOpen::find(_RecId);
    }
    callerSKS_LB_JournalARErrors.CustTransRecId = lcustTransOpen.RefRecId;
    element.args().caller().seterrorslookup(true);
}

/// <summary>
/// refresh data source
/// </summary>
public void executeQuery()
{
    Query                   q;
    //QueryBuildRange         qbr;
    QueryBuildDataSource    qbds, qbdsCT, qbdsCTO;
    SKS_LB_MatchingRules    MatchingRules;
    SKS_LB_Bank             SKS_LB_Bank;
    SKS_LB_MatchType        lastMatchType;
    ;

    SKS_LB_Bank = SKS_LB_Bank::find(callerSKS_LB_JournalARErrors.BankAcct, callerSKS_LB_JournalARErrors.FormatID);

    q = SKS_LB_InvoiceMatch_ds.query();
    qbds = q.dataSourceTable(tableNum(SKS_LB_InvoiceMatch));

    qbds.clearRanges();

    while select lookuptype from MatchingRules order by MatchingRules.lookuptype where MatchingRules.GroupID == SKS_LB_Bank.MatchingRulesGroupId
    {
        if(MatchingRules.lookuptype != lastMatchType)
        {
            qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, MatchType)).value(enum2str(MatchingRules.LookupType));
        }
        lastmatchType = MatchingRules.lookuptype;
    }

    qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, Direction)).value(enum2Str(SKS_LB_MatchTypeDirection::Forward));

    if(callerSKS_LB_JournalARErrors.ActualSettlementAmountCur < 0)
    {
        qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, CTOAmountCur)).value('<0');
    }
    else
    {
        qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, CTOAmountCur)).value('>0');
    }

    qbdsCT = q.dataSourceTable(tableNum(CustTrans));
    qbdsCT.joinMode(JoinMode::InnerJoin);
    qbdsCT.addLink(fieldNum(SKS_LB_InvoiceMatch, CustTransRecId), fieldNum(CustTrans, RecId));

    qbdsCTO = q.dataSourceTable(tableNum(CustTransOpen));
    qbdsCTO.joinMode(JoinMode::InnerJoin);
    qbdsCTO.addLink(fieldNum(SKS_LB_InvoiceMatch, CustTransOpenRecId), fieldNum(CustTransOpen, RecId));
    if(accountNum != '')
    {
        qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, CustAccount)).value(accountNum);
        qbdsCT.addRange(fieldNum(CustTrans, AccountNum)).value(accountNum);
    }

    q.allowCrossCompany(true);
    q.addCompanyRange(accountNumCompany);

    this.query(q);
    super();
}

/// <summary>
/// refresh data source
/// </summary>
public void executeQuery()
{
    container sharedCompanyList;
    CompanyId company;
    int i;
    Query                   q;
    //QueryBuildRange         qbr;
    QueryBuildDataSource    qbds, qbdsCT, qbdsCTO;
    SKS_LB_MatchingRules    MatchingRules;
    SKS_LB_Bank             SKS_LB_Bank;
    SKS_LB_MatchType        lastMatchType;
    ;

    SKS_LB_Bank = SKS_LB_Bank::find(callerSKS_LB_JournalARErrors.BankAcct, callerSKS_LB_JournalARErrors.FormatID);

    q = SKS_LB_InvoiceMatchMC_ds.query();
    qbds = q.dataSourceTable(tableNum(SKS_LB_InvoiceMatch));

    qbds.clearRanges();

    while select lookuptype from MatchingRules order by MatchingRules.lookuptype where MatchingRules.GroupID == SKS_LB_Bank.MatchingRulesGroupId
    {
        if(MatchingRules.lookuptype != lastMatchType)
        {
            qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, MatchType)).value(enum2str(MatchingRules.LookupType));
        }
        lastmatchType = MatchingRules.lookuptype;
    }

    qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, Direction)).value(enum2Str(SKS_LB_MatchTypeDirection::Forward));

    if(callerSKS_LB_JournalARErrors.ActualSettlementAmountCur < 0)
    {
        qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, CTOAmountCur)).value('<0');
    }
    else
    {
        qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, CTOAmountCur)).value('>0');
    }

    qbdsCT = q.dataSourceTable(tableNum(CustTrans));
    qbdsCT.clearRanges();
    qbdsCT.joinMode(JoinMode::InnerJoin);
    qbdsCT.addLink(fieldNum(SKS_LB_InvoiceMatch, CustTransRecId), fieldNum(CustTrans, RecId));

    qbdsCTO = q.dataSourceTable(tableNum(CustTransOpen));
    qbdsCTO.clearRanges();
    qbdsCTO.joinMode(JoinMode::InnerJoin);
    qbdsCTO.addLink(fieldNum(SKS_LB_InvoiceMatch, CustTransOpenRecId), fieldNum(CustTransOpen, RecId));
    if(accountNum != '')
    {
        qbds.addRange(fieldNum(SKS_LB_InvoiceMatch, CustAccount)).value(accountNum);
        qbdsCT.addRange(fieldNum(CustTrans, AccountNum)).value(accountNum);
    }
    q.allowCrossCompany(true);
    sharedCompanyList = SKS_LB_54000Bas::LBFindSharedServiceCompanies(SKS_LB_Bank);

    for (i = 1; i <= conlen(sharedCompanyList); i++)
    {
        company = conpeek(sharedCompanyList, i);
        q.addCompanyRange(company);
    }
    this.query(q);
    super();
}

public void tabChanged(int _fromTab, int _toTab)
{
    ;

    super(_fromTab, _toTab);

    switch(_toTab)
    {
        case 1:
            element.selectMode(CustTrans_Invoice);
            CustTrans_Invoice.setFocus();
            useCurrentCompanyTab = true;
            break;
        case 2:
            element.selectMode(CustTransMC_Invoice);
            CustTransMC_Invoice.setFocus();
            useCurrentCompanyTab = false;
            break;
    }
}
